sys_variable_value.value:
(function execute(inputs, outputs) {

  if(inputs.status_code=="200"){

  var responsebody = JSON.parse(inputs.response_body);

   outputs.lastname = responsebody.localizedLastName;
   outputs.firstname = responsebody.localizedFirstName;
   outputs.headline = responsebody.localizedHeadline;
   outputs.profileid = responsebody.id;

  }


// ... code ...
})(inputs, outputs);

